import React from 'react';
import Configuration from './Configuration';
import ReactDOM from 'react-dom';


class Home extends React.Component {
    render() {
    return(
        <div>
            <h2>Accueil</h2>
            <p>Hello {Configuration.state.value}</p>
        </div>);

    }
}

export default Home;
